general/cordova.html.body:
Cordova
Clicktale supports tracking and recording the screen for apps built with Cordova.
In order to get started with Cordova, you will need to add the plugin as such:
cordova plugin add https://github.com/Clicktale/cordova-plugin-clicktale.git
Currenly we support Android and iOS only via Cordova and the examples below apply to both platforms.
Getting Started
In order to start the Clicktale data collection and recording, please call
ClicktalePlugin.startClicktale("[ACCESS KEY]", "[SECRET KEY]", success, failure);

In all the code exmpales, success and faliure are function callbacks from the Clicktale - Cordova bridge, giving you some feedback if the API call succeeded or not
    var success = function() {}

    var failure = function(errorCode) {}

Tracking Events
It is possible to track events via that following JS APIs:
ClicktalePlugin.trackEvent("CORDOVA EVENT", success, failure);

ClicktalePlugin.trackEventAndValue("CORDOVA EVENT", "DEVICE READY" ,success, failure);

Tracking Page-Views
Use the following to track the Page View event:
ClicktalePlugin.trackPageView("CORDOVA PAGE", success, failure);

Setting the User ID
To track the session user ID, use the following API:
ClicktalePlugin.setSessionUserID("USER ID", success, failure);

Handling Privacy
In cases where you would like to pause the recording or hide the entire screen, use the following APIs:
ClicktalePlugin.startHidingScreen(success, failure);
// Or to pause at the current frame:
ClicktalePlugin.pauseScreenRecording(success, failure);

To stop hiding the screen or resume recording:
ClicktalePlugin.stopHidingScreen(success, failure);
// Or to resume after recording was paused:
ClicktalePlugin.resumeScreenRecording(success, failure);

Recording lifecycle callbacks
If you would like to hook on the recording start events that fire when the Clicktale recorder begins, you can use the following addEventListener calls:
document.addEventListener( 'onClicktaleSessionURLCreated' ,this.ClicktaleSessionURLCreated);

document.addEventListener( 'onClicktaleSessionIDCreated'  ,this.ClicktaleSessionIDCreated);

Then the implementation of these functions can be something like:
ClicktaleSessionURLCreated: function(e) {
    var success = function() {}

    var failure = function(errorCode) {}

    ClicktalePlugin.trackEventAndValue("CORDOVA EVENT - SessionURL", e.URL ,success, failure);
},

ClicktaleSessionIDCreated: function(e) {
    var success = function() {}

    var failure = function(errorCode) {}

    ClicktalePlugin.trackEventAndValue("CORDOVA EVENT - SessionID", e.SessionID ,success, failure);
}

Getting the session link
In events where the lifecycle callbacks are not sufficient for your implementation, it is also possible to get the session link using a specific API - this link will later send you directly to the video recording of the session that is currently being recorded.
ClicktalePlugin.getSessionLink(success, failure);

Disabling Clicktale's crash reporter
In some cases, your app may already be using a crash reporter and to avoid conflicts, it may be required to turn off Clicktale's crash reporter, you can do that using the following API:
ClicktalePlugin.setCrashReporterOff(success, failure);

Debug Mode
In order to enable debug mode which outputs verbose logging to the console, you can use the following API:
ClicktalePlugin.setDebugLogLevelOn(true, success, failure);

It is also possible to set the videos to be saved into the device media library, using the following API:
ClicktalePlugin.setVideoTestMode(true, success, failure);

Note, do not release an app with that setting enabled, as it will store the recorded videos on your uses devices.

ios/privacy.html.body:
Privacy
As our SDK will record everything displayed on your clients screens, it is important to have the ability to hide sensitive information or presonally identifyable information (PII).
The way it will be seen in the rendered video will be a black box around wherever was set to be hidden.


Hide any UIView or UITextField
In our iOS SDK, you will need to use two methods in order to hide any UIView.
One for starting the privacy mode for views, and one for stopping it.
It is important to stop it so there will be no performance hit on the application later on.
-(void)startPrivacyForViews:(NSArray  *)views; 
-(void)stopPrivacyForAllViews;

Or with Swift
func startPrivacy(forViews controls: [Any]!)
func stopPrivacyForAllViews()

You should try to start privacy in - (void)viewWillAppear:(BOOL)animated and stop it in (void)viewDidDisappear:(BOOL)animated
Example:
-(void)viewWillAppear:(BOOL)animated
{ 
    [[Clicktale sharedInstance] startPrivacyForViews: @[self.viewSensitive, self.viewPrivate, self.textFieldSensitive]]; 
    [super viewWillAppear:animated];
} 

-(void)viewDidDisappear:(BOOL)animated
{ 
    [super viewDidDisappear:animated];
    [[Clicktale sharedInstance] stopPrivacyForAllViews]; 
}

Or with Swift:
override func viewWillAppear(animated: Bool) {
    Clicktale.sharedInstance().startPrivacy(forViews: [self.viewPrivate, self.viewPrivate, self.textFieldSensitive]) 
}

override func viewDidDisappear(animated: Bool) { 
    super.viewDidDisappear(animated)
    Clicktale.sharedInstance().stopPrivacyForAllViews() 
}

Secure UITextField
The SDK automatically hides any secure UITextField, the automatic hiding happens only once the user focus into the field on the first time.
Hide the whole screen
It is possible to hide the whole screen, by that manner the recording shal show a black scrren until you stop hidding it:
  .......
  //In any point that you do not want to capture the screen
  [[Clicktale sharedInstance] startHidingScreen];
  .....

Or with Swift:
    Clicktale.sharedInstance().startHidingScreen()

Do not forget to stop hidding
  .......
  //In any point that you want to resume capturing the screen
  [[Clicktale sharedInstance] stopHidingScreen];
  .....

Or with Swift:
    Clicktale.sharedInstance().stopHidingScreen()

In addtion you can check whether the screnn is hidden 
  .......
  [[Clicktale sharedInstance] isScreenHidden];
  .....

Or with Swift:
    Clicktale.sharedInstance().isScreenHidden()

PII in WebViews
In a case you have WebViews in your application (UIWebView or WKWebView) that has web-pages you control and have some PII on them you want to hide.

Use the 'ctHidden' CSS class on that HTML element 


Call the following API to start privacy on the view (UIWebView or WKWebView)
-(void)viewWillAppear:(BOOL)animated
{
 NSArray *sensitiveViewsReferenceArray = @[self.webView];
 // Then send that array to SDK
 [[Clicktale sharedInstance] startPrivacyForWebViews:sensitiveViewsReferenceArray];

 [super viewWillAppear:animated];
}

Or with Swift:
override func viewWillAppear(animated: Bool) {
 Clicktale.sharedInstance().startPrivacy(forWebViews: [self.webView]) 
}


Call the following API to stop privacy on the view-(void)viewDidDisappear:(BOOL)animated
{
[super viewDidDisappear:animated]; 
[[Clicktale sharedInstance] stopPrivacyForAllWebViews];
}

Or with Swift:override func viewDidDisappear(animated: Bool) { 
 super.viewDidDisappear(animated)
 Clicktale.sharedInstance().stopPrivacyForAllWebViews() 
}



More Granularity
In some cases, you might want to have more control over hiding or showing different elements of your application during the playback, at any time during the view controller lifetime.
This can be done via using the startPrivacy API as above, and in order to stop privacy for a specific view at a specific time during the lifetime of your application or view controller.
  [[Clicktale sharedInstance] stopPrivacyForViews: @[self.viewSensitive]];
  [[Clicktale sharedInstance] stopPrivacyForWebViews: @[self.webView]];

Or with Swift:
  Clicktale.sharedInstance().stopPrivacy(forViews: [self.viewPrivate]) 
  Clicktale.sharedInstance().stopPrivacy(forWebViews: [self.webView])

Stop and clear all PII
You can clear all the PII list on the SDK with this method:
  [[Clicktale sharedInstance] stopPrivacyForAll];

 Or with Swift:
  Clicktale.sharedInstance().stopPrivacyForAll()

UITableViewController & PII
When working with UITableViewController and PII you should specify for each component in the cell that you would like to hide and because of cell reuse you sould remove this component at reuse:
For example, this is a custom cell:
@interface CTTableViewCell : UITableViewCell
@property (weak, nonatomic) IBOutlet UITextField *sTextField;
@property (weak, nonatomic) IBOutlet UIView *sView;
@end

Manage cell Hide/Show components
- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {

    CTTableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@"Cell" forIndexPath:indexPath];

    if(indexPath.row % 2 == 0)//Decide if we want to hide components
    {
        cell.sView.backgroundColor = [UIColor redColor];
        cell.sTextField.text = @"DO NOT SHOW ME!!!";
        [[Clicktale sharedInstance] startPrivacyForViews:@[cell.sView, cell.sTextField]];        
    }
    else
    {
        cell.sView.backgroundColor = [UIColor yellowColor];
        cell.sTextField.text = @"HI";
        [[Clicktale sharedInstance] stopPrivacyForViews:@[cell.sView, cell.sTextField]];
    }

    return cell;
}

UICollectionViewController & PII
When working with UICollectionViewController and PII you should specify each UICollectionViewCell that you would like to hide and because of cell reuse you should remove this cell from PII at reuse:
Manage your hidden cells:
var hiddenCells = [UICollectionViewCell]()

Manage cell Hide/Show components
 override func collectionView(_ collectionView: UICollectionView, cellForItemAt indexPath: IndexPath) -> UICollectionViewCell {

    let cell = collectionView.dequeueReusableCell(withReuseIdentifier: "Cell", for: indexPath) as! ItemCell

    //Select cell to Hide PII                  
    if(indexPath.row % 2 == 0)
    {
        hiddenCells.append(cell)
        Clicktale.sharedInstance().startPrivacy(for: [cell])
    }
    else
    {
        if let index = hiddenCells.index(of: cell)
        {
               hiddenCells.remove(at: index)
               Clicktale.sharedInstance().stopPrivacy(for: [cell])
        }
    }

   return cell
}

 override func viewDidDisappear(_ animated: Bool) {
    super.viewDidDisappear(animated)
    Clicktale.sharedInstance().stopPrivacy(for: hiddenCells)
}

override func viewWillAppear(_ animated: Bool) {
    super.viewWillAppear(animated)
    Clicktale.sharedInstance().startPrivacy(for: hiddenCells)
}

Pause Screen Recording
There is an ability to pause and resume acreen recording
Pause Screen Recording:
 [[Clicktale sharedInstance] pauseScreenRecording];

 Or with Swift:
 Clicktale.sharedInstance().pauseScreenRecording()

Resume Screen Recording:
 [[Clicktale sharedInstance] resumeScreenRecording];

 Or with Swift:
 Clicktale.sharedInstance().resumeScreenRecording()

Check if the screen is Recorded:
 [[Clicktale sharedInstance] isScreenRecorded];

 Or with Swift:
 Clicktale.sharedInstance().isScreenRecorded()

ios/push-notifications.html.body:
Push Notifications
When working with push notifications, many of our customers see value by tracking push notifications opens - and segmenting according to data that was created by that push message - meaning sessions which began after the open of the message.
This helps our customers to analyze the impact of a push message by watching the video recordings of such sessions and looking at heatmaps of data which was generated by the push message.
Tracking Push Notifications
On iOS, in order to track opening of push notification please add to your didReceiveRemoteNotification the following code snippet, it is possible that if already tracking a push message, some of this code will already be present and just extend it as required. This code specifically will wait for 10 seconds before firing the open event to ensure both Clicktale already started to record and this open is actually an actionable session. It fires our code in a background thread.
This code will also send the entire payload (userInfo) to Clicktale as the event data - it is recommended to change this to something that would make it easier for you to track (like a push message id, a title or anything that would have some business meaning) as the value is search-able inside of the Clicktale for Apps platform.
Also note, that we only track the opening of a push message, and not the arrival of one, this is because we are looking to link a session recording to the data, and there is no session unless the push message was opened.
- (void)application:(UIApplication *)application didReceiveRemoteNotification:(NSDictionary *)userInfo fetchCompletionHandler:(void (^)(UIBackgroundFetchResult result))completionHandler
{
    // other code

    //We wait for the application to start and for a new Clicktale recording session to start
    dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(10 * NSEC_PER_SEC)), dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_HIGH,0), ^{

        if(UIApplication.sharedApplication.applicationState == UIApplicationStateActive)
        {
            NSError *error;
            NSData *jsonData = [NSJSONSerialization dataWithJSONObject:userInfo options:NSJSONWritingPrettyPrinted error:&error];

            if (error == nil && jsonData != nil)
            {
                [[Clicktale sharedInstance]trackEvent:@"RemoteNotificationReceived" value:[[NSString alloc] initWithData:jsonData encoding:NSUTF8StringEncoding]];
            }
            else
            {
                [[Clicktale sharedInstance]trackEvent:@"RemoteNotificationReceived"];
            }
        }

    });

    // other code
}

Or with Swift:
 func application(_ application: UIApplication, didReceiveRemoteNotification userInfo: [AnyHashable : Any], fetchCompletionHandler completionHandler: @escaping (UIBackgroundFetchResult) -> Void) {
        // other code

        //We wait for the application to start and for a new Clicktale recording session to start
        DispatchQueue.global().asyncAfter(deadline: .now() + 10.0)
        {
            if(UIApplication.shared.applicationState == .active)
            {
                do
                {
                    let jsonData = try JSONSerialization.data(withJSONObject: userInfo, options: .prettyPrinted)

                    if let jsonString =  String(bytes: jsonData, encoding: String.Encoding.utf8)
                    {
                        Clicktale.sharedInstance().trackEvent("RemoteNotificationReceived", value: jsonString)
                    }
                }
                catch
                {
                    Clicktale.sharedInstance().trackEvent("RemoteNotificationReceived")
                }
            }
        }

        // other code      
    }

