AppDynamics Integration
When using both Clicktale for Apps and AppDynamics, you can now integrate the systems and for each session shown in AppDynamics, you can see the corresponding Clicktale session(s). 
In Clicktale for Apps, when a session begins, which may be on first activation (‘splash screen’ like) or when resuming from background after some time of inactivity, a delegate/callback is used to signal that a new session has begun. At that point you could send AppDynamics Clicktale's session link in two different ways:

Using AppDynamics breadcrumbs
Using AppDynamics user data.

Sessions are tracked differently
In AppDynamics, sessions are tracked differently than they are inside Clicktale.
While Clicktale by defaults starts a new session after 15 seconds of inactivity in the background, AppDynamics does not - so it is possible (and even expected) to see for a single session, several breadcrumbs updates and several links to sessions inside Clicktale.
Using AppDynamics breadcrumbs
The delegate function should be used like this for iOS:
-(void)clicktaleDidSessionURLCreated:(NSString *)sessionLink
{ 
  [ADEumInstrumentation leaveBreadcrumb:sessionLink mode:ADEumBreadcrumbVisibilityCrashesAndSessions];
}

Or with Swift:
func clicktaleDidSessionURLCreated(_ sessionLink: String!) 
{  
  ADEumInstrumentation.leaveBreadcrumb(sessionLink, mode: .crashesAndSessions)
}

And for android:
@Override
public void onSessionURLCreated(String sessionLink) {
      Instrumentation.leaveBreadcrumb(sessionLink, BreadcrumbVisibility.CRASHES_AND_SESSIONS);
}

Using AppDynamics user data
The delegate function should be used like this for iOS:
